      id: "tags",
    },
    {
      path: "/Main",
      title: "Main",
      icon: EditIconOutlined,
      id: "main",
    },
    {
      path: "/Schemas",
      title: "Schemas",
      icon: EditIconOutlined,
      id: "schemas",
    },
    {
      path: "/Wizards",
      title: "Wizards",
